for your web app. Returned during a call to C<DescribeWebApp>.

=head1 ATTRIBUTES


=head2 ApplicationArn => Str

The Amazon Resource Name (ARN) for the IAM Identity Center application:
this value is set automatically when you create your web app.


=head2 InstanceArn => Str

The Amazon Resource Name (ARN) for the IAM Identity Center used for the
web app.


